import axios from "axios";

const tenyesztok = "http://localhost:8090/api/tulaj";

class FajtaService {
  getTenyesztok() {
    return axios.get(tenyesztok);
  }

  getTenyesztoById(fajtaId) {
    return axios.get(tenyesztok + "/" + fajtaId);
  }
  getFajtaByRovidites(rovidites) {
    return axios.get(tenyesztok + "/" + rovidites);
  }

}

export default new FajtaService();
